<style>
.fixed-wrapper {
    position: fixed;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    overflow-x: hidden;
    overflow-y: auto;
}
.fixed-wrapper .content-wrapper {
    min-height: 100%;
    width: 100%;
    padding-top: 66px;
    box-sizing: border-box;
}
.fixed-wrapper .content-wrapper .logo {
    width: 366px;
    height: 39px;
    margin: 0 auto;
    padding-bottom: 35px;
}
.fixed-wrapper .content-wrapper .image {
    position: relative;
    width: 100%;
    height: 268px;
    margin: 0 auto;
    text-align:center;
}
.fixed-wrapper .content-wrapper .image img{
    width: 100%;
    max-width: 437px;
    height: auto;
}
.fixed-wrapper .content-wrapper .image .text {
    position: absolute;
    bottom: 0;
    left:0;
    display: inline-block;
    width: 100%;
    text-align: center;
    font-size:16px;
    font-family:Microsoft YaHei;
    font-weight:400;
    color:rgba(102,102,102,1);
}
.fixed-wrapper .content-wrapper .image .text span {
    margin-left: 20px;
}
.fixed-wrapper .content-wrapper .btn {
    width: 150px;
    height: 44px;
    margin: 0 auto;
    padding-top: 46px;
}
.fixed-wrapper .content-wrapper .btn button {
    width: 150px;
    height: 44px;
    border: 1px solid #CA0003;
    color: #CA0003;
    border-radius: 22px;
    cursor: pointer;
    outline: transparent;
    background-color: transparent;
    box-shadow: 0 0 0 0;
}
</style>
